import React from 'react';

class Graph extends React.Component {
	constructor(props) {
		super(props)
		this.state = {
			players: this.props.players
		}
	}

	render() {
		console.log(this.state.players)
		var players = this.state.players.map(x => {
			return <li key={x}>{x}</li>
		})
		console.log(players)

		return (
			<div>
				players
			</div>
		)
	}
}

export default Graph;
